import React, { useState } from "react";
import Task from "./Task";

export const Tasks = ({ tasks }) => {
  return (
    <div>
      {tasks.map((task) => {
        return <h1 key={task.id}>{task.item}</h1>;
      })}
    </div>
  );
};
